import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom';

//RDX
import {Provider} from 'react-redux';
import {createStore, applyMiddleware, compose} from 'redux';
import thunk from 'redux-thunk';

import reducers from './components/Midwares/rdx/reducers/index.js'

const store = createStore(reducers, compose(applyMiddleware(thunk)));

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <Provider store = {store}>
    <div 
    style={{  
                        backgroundImage: "url(" + "https://thumbs.dreamstime.com/z/seamless-vector-pattern-black-white-geometrical-background-hand-drawn-decorative-tribal-elements-print-ethnic-fol-88643804.jpg" + ")",
                        backgroundPosition: 'center',
                        backgroundSize: 'cover',
                        backgroundRepeat: 'repeat'
                    }}
      className="opacity-40"> 

        <App/>
      </div>
    </Provider> 
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('mzizi')
);
